import Login from "./Login";
import Signup from "./Signup";
import framImage from '../assets/frame.png'

function Template(){
    return (
        <div>
            <div>
                <h1>{title}</h1>
            </div>
            <p>
                <span>{desc1}</span>
                <span>{desc2}</span>
            </p>

            {
                formtype === Signup ? (<SignupForm/>) : (<LoginForm/>) 
            }

            <div></div>
            <p>OR</p>
            <div></div>

            <button>
                <p>Sign Up with Google</p>
            </button>

            <div>
                <img src="frameImage" alt="frame"></img>
                <img src={image} alt="photo" ></img>
            </div>
        </div>
    )
}
export default Template;
